function stats = analyzeSignal(t, signal)
    stats.mean = mean(signal);
    stats.max  = max(signal);
    stats.min  = min(signal);
    stats.duration = t(end) - t(1);

    fprintf(['Mean: %.3f | Max: %.3f | Min: %.3f | ' ...
             'Duration: %.2f s\n'], ...
             stats.mean, stats.max, stats.min, stats.duration);
end


t = 0:0.1:10;
sigA = sin(t);
sigB = cos(t);
sigC = sigA + 0.5 * sigB;

signals = [sigA.' sigB.' sigC.'];

figure %[output:393ee741]
plot(t, sigA, t, sigB, t, sigC) %[output:393ee741]
grid on %[output:393ee741]
legend('Signal A','Signal B','Signal C') %[output:393ee741]


analyzeSignal(t, sigA) %[output:121c6d28] %[output:1b14c700]
analyzeSignal(t, sigB) %[output:50af7f5e] %[output:09925e1f]
analyzeSignal(t, sigC) %[output:51039cf7] %[output:4d289ee7]


